import React from 'react'

import "./Toggle.css"
import Sun from "../../image/sun.png"

import Moon from "../../image/moon.png"

const Toggle = () => {
  return (
    <div className='t'>
        <img src = {Sun}alt = ""className="t-icon"/>
        <img src = {Moon}alt = ""className="t-icon"/>
        
        </div>
  )
}

export default Toggle ;
